import Axios from "axios";
import {useState, useEffect } from 'react'

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    fetch('/api')
      .then((res) => res.json())
      .then((data) =>setData)
  })

  return (
    data == null ? (
      <div className="App">
        no data 
      </div>
    ) : (
      <div className="App">
        test
    </div>
    )
  );
}

export default App;
